import React, { Component } from "react";

class CARDS extends Component {
  render() {
    const { productos,agre } = this.props;
    const { agregarCarro } = this.props;

    return (
      <div className="center flexC">
        {productos.map((el) => (
          <div className="card">
            <li key={el.name}>
              <img alt={el.name} src={el.img} className="card__img"></img>
              <h2 className="card__title">{el.name}</h2>
              <h6 className="card__price">{el.price}</h6>
              <button onClick={agregarCarro} className="card__btn">
                Agregar al carro
              </button>
            </li>
          </div>
        ))}
      </div>
    );
  }
}
export default CARDS;

